class Solution(object):

    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        longest_sequence_count = 0
        skippable_count = 0
        for current_index in range(0, len(s)):
            seen_char = {}
            seen_char[s[current_index]] = True
            sequence_count = 1

            if skippable_count > 0:
                skippable_count -= 1
                break

            for sub_index in range(current_index + 1, len(s)):
                if s[sub_index] in seen_char:
                    break
                else:
                    seen_char[s[sub_index]] = True
                    sequence_count += 1

            if longest_sequence_count < sequence_count:
                longest_sequence_count = sequence_count

        return longest_sequence_count

